import React from 'react';

const ListingDisplay = (props) => {

    const renderData = ({listData}) => {
        if(listData){
            if(listData.length > 0){
                return listData.map((item) => {
                    return(
                        <>
                        <p>data found</p>
                        </>
                    )
                })
            }
            
        }
        else{
            return(
                <div>
                    <h2>Loading......</h2>
                    <img src='images/loader.gif' alt=''/>
                </div>
            )
        }
        
    }

    return(
        <>
           {renderData(props)}
        </>
    )
}

export default ListingDisplay;
